Description
One Guy. Fourteen Girls. Endless Possibilities. Meet Jack Napier. His signature line for Vouyer Media, the It`s Big, It`s Black, It`s Jack franchise, has won the coveted AVN Award for Best Interracial Series for the last two years running. And fresh off those stunning back-to-back victories, this tireless performer/director is ready to score a three-peat with the most ambitious release of his career. It`s Big, It`s Black, It`s Jack #10 is an epic celebration of his tenth year in the business that pairs him up with no less than fourteen of the sexiest young sirens in the game today. The biggest innovation here is Jack`s decision to feature two girls in every scene, and it`s a casting choice that`s sure to please even the most demanding interracial fan. Whether you`re into teens, Asians, blondes, brunettes, redheads, big boobs or cougars, you`re sure to find a three-way scenario here that fits your fetish like a hand in a velvet glove. Whatever you want..
